class Solution:
    def minDominoRotations(self, A, B) -> int:
        N = len(A)
        swaps = 0
        i = 1
        aSame = A[0]
        bSame = B[0]
        allSame = 0 if A[0] != B[0] else 1
        while i < N:
            if A[i] == aSame:
                bSame = -1 if B[i] != bSame else bSame
            elif B[i] == bSame:
                aSame = -1
            elif A[i] == bSame:
                swaps += 1
                aSame = -1 if B[i] != aSame else aSame
            elif B[i] == aSame:
                swaps += 1
                bSame = -1
            else:
                return -1
            if A[i] == B[i]:
                allSame += 1
            i += 1
        return min(swaps, N - allSame - swaps) if swaps != -1 else -1


